import React from 'react';

class Item extends React.Component {
    render() {
        return (
            <li>{this.props.name}</li>
        )
    }
}

class App extends React.Component {
    render() {
        return (
            <ul>
                <Item name="Apple" />
                <Item name="Orange" />
            </ul>
        )
    }
}

export default App;
